<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Русакова Ангелина Игоревна родится восемнадцатого апреля 2830. <br><p>Двадцать седьмого октября 2554 устроится на работу в Фонд на должность  работника органов загса. </p><p>	Окончательно уволится двадцать шестого апреля 2829. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
